import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Calcolo Combinatorio</h1>
      <fieldset>
        <legend>Operazione da eseguire</legend>
      </fieldset>
      <form>
        <input type="number" placeholder='N' />
        <input type="number" placeholder='K' />
      </form>
      <button>Calcola</button>
    </div>
  );
}

export default App;
